import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import CustomButton from '../Components/Button.jsx';
import TitleSubtitle from '../Components/TitleSubtitle.jsx';
import CopyrightText from '../Components/CopyrightText';
import Popup from '../Pages/Popup.jsx'; // Importez le composant Popup
import '../Pages/styles.css'; // Importez les styles CSS
import { BiArrowBack } from 'react-icons/bi'; 


function Enrollment() {
  const [showPopup, setShowPopup] = useState(false);

  const handleEnregistrerClick = () => {
    setShowPopup(true);
  };

  const handleClosePopup = () => {
    setShowPopup(false);
  };

  return (
    <div>
      {/* Bouton Retour avec icône */}
      <Link to="/Home">
        <CustomButton variant="back">
          <BiArrowBack /> Retour
        </CustomButton>
      </Link>

      {/* Titre et sous-titre */}
      <TitleSubtitle title="Enroler" subtitle="les contribuables" />

      {/* Formulaire d'enrôlement */}
      <form>
        <div>
          <input type="text" placeholder="Nom et prénom*" />
        </div>
        <div>
          <input type="text" placeholder="Raison sociale" />
        </div>
        <div style={{ display: 'flex', justifyContent: 'space-between' }}>
          <select>
            <option value="" disabled selected>Zone</option>
            <option value="zone1">Zone 1</option>
            <option value="zone2">Zone 2</option>
            {/* Ajoutez plus d'options si nécessaire */}
          </select>
          <select>
            <option value="" disabled selected>Secteur</option>
            <option value="secteurA">Secteur A</option>
            <option value="secteurB">Secteur B</option>
            {/* Ajoutez plus d'options si nécessaire */}
          </select>
        </div>
        <div style={{ display: 'flex', justifyContent: 'space-between' }}>
          <input type="text" placeholder="Téléphone 1" />
          <input type="text" placeholder="Téléphone 2" />
        </div>
        <div>
          <input type="text" placeholder="Montant" />
        </div>
        <div>
          <select>
            <option value="" disabled selected>Catégorie</option>
            <option value="categorie1">Catégorie 1</option>
            <option value="categorie2">Catégorie 2</option>
            {/* Ajoutez plus d'options si nécessaire */}
          </select>
        </div>
        <button onClick={handleEnregistrerClick}>Enregistrer</button>
      </form>

      {/* Pop-up */}
      {showPopup && <Popup onClose={handleClosePopup} />}

      {/* Composant pour le droit d'auteur */}
      <CopyrightText />
    </div>
  );
}

export default Enrollment;
